INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 100, 0.0, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 1, 130011, 3001, 2, 3001100, "ヤマト", -416.5, 2.1);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 101, 0.0, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 4, 130011, 3001, 2, 3001101, "ヤマト", -416.5, 5.68);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 102, 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1, 130011, 3001, 1, 3001102, "ヤマト", -416.5, 0.0);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 100, 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1, 130211, 3002, 1, 3002100, "フブキ", -416.5, 0.0);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 101, 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1, 130211, 3002, 1, 3002101, "フブキ", -416.5, 0.0);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 102, 0.0, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 5, 130211, 3002, 2, 3002102, "フブキ", -416.5, 8.53);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 103, 0.0, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 7, 130211, 3002, 1, 3002103, "フブキ", -416.5, 5.67);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 104, 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1, 130211, 3002, 1, 3002104, "フブキ", -416.5, 0.0);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 300, 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3, 130211, 3004, 3, 3002300, "フブキ", -416.5, 0.0);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 301, 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7, 130211, 3005, 7, 3002400, "フブキ", -416.5, 0.0);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 200, 0.0, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 2, 130211, 3003, 1, 3003200, "フブキ", -416.5, 4.4);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES ("2024/10/31 12:00:00", "2030/01/01 14:59:59", 201, 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7, 130211, 3003, 7, 3003201, "フブキ", -416.5, 0.0);
